import classes from "./NavbarItem.module.css";

const NavBarItem = (props) => {
  const Duummy_navbar = [
    {
      type: "Stays",
      icon: "fa-bed",
      active: true,
    },
    {
      type: "Flights",
      icon: "fa-plane",
      active: false,
    },
    {
      type: "Car rentals",
      icon: "fa-car",
      active: false,
    },
    {
      type: "Attractions",
      icon: "fa-bed",
      active: false,
    },
    {
      type: "Airport taxis",
      icon: "fa-taxi",
      active: false,
    },
  ];
  return (
    <div className={classes.navbaritem}>
      <image>abc</image>
      <p className={classes.p}>{props.type}</p>
    </div>
  );
};
export default NavBarItem;
